import React from 'react';

const Pagination = ({setPageNumber}) => { 
    let x;
    let next = () => {  
        if(x>1){
            setPageNumber((x) => x+1);
        }
    };
    let prev = () => {
        if(x<42){
            setPageNumber((x) => x-1);
        }
    };

    return(
        <div className='container'>
            <button className='btn btn-light' onClick={prev}> prev </button>
            <button className='btn btn-light' onClick={next}> next </button>

        </div>
    );
};

export default Pagination;
